import React from "react";
import TodoItemContainer from "./TodoItemContainer";

const TodosList = ({ todos, completeTaskClickHandler, changeTaskClickHandler }) => {
   const notCompletedTodos = todos
      .filter((todo) => !todo.completed)
      .map((todoItem) => (
         <TodoItemContainer
            key={todoItem.id}
            id={todoItem.id}
            title={todoItem.title}
            completed={todoItem.completed}
            completeTaskClickHandler={completeTaskClickHandler}
            changeTaskClickHandler={changeTaskClickHandler}
         />
      ));
   const completedTodos = todos.filter((todo) => todo.completed);
   return (
      <div>
         {notCompletedTodos}
         {completedTodos.map((todoItem) => (
            <TodoItemContainer key={todoItem.id} id={todoItem.id} title={todoItem.title} />
         ))}
      </div>
   );
};

export default TodosList;
